import React from "react";
import ReactDom from "react-dom";

//CSS
import "./index.css";
function JobList() {
  return <section></section>;
}
const JobInstance = () => {
  return (
    <article>
      <Image />
    </article>
  );
};
const Image = () => (
  <img
    src="https://images.theconversation.com/files/93616/original/image-20150902-6700-t2axrz.jpg?ixlib=rb-1.1.0&q=45&auto=format&w=1000&fit=clip"
    alt=""
  />
);
const Title = () => <p>Title here</p>;
ReactDom.render(<JobList />, document.getElementById("root"));
